import Card from "./elements/Card";

class CardList extends React.Component {
  state = { data: [] };

  componentDidMount() {
    fetch("http://127.0.0.1:5000/item/apple")
      .then(res => res.json())
      .then(db => {
        this.setState({ data: db });
      })
      .catch(console.log);
  }

  renderCards = () => {
    if (this.state.data !== undefined) {
      this.state.data.map(item => {
        {
          <Card data={item} />;
        }
      });
    }
  };

